import {useState} from 'react'
import CarData from '../../data/CarData'
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
    filterWrap: {
        width: '100vw',
        background : 'red',

        justifyContent: 'center',
    },
    filter: {
        display: 'flex',
        fontSize: '2rem',
        padding: 25,

    },
    afilter  : {

    }
  });


function 카리스트뷰() {
    const classes = useStyles();
    let [카데이터, 변동카데이터] = useState (CarData)
    return(
        <div>
            <차량필터/>
           {
               카데이터.map((a,i)=>{
                   return ( 
                       <카정보컴포넌트 carlist={a}/>
                   )
               })
           }
        </div>
    )
}

export default 카리스트뷰

function 차량필터(props) {
    const classes = useStyles();

    return (
        <div className={classes.filterWrap}>
            <ul className={classes.filter}>
                <li>전체</li>
                <li>대기</li>
                <li>경차</li>
                <li>소형</li>
                <li>중형</li>
                <li>대형</li>
                <li>승합</li>
            </ul>
        </div>
    )
}


function 카정보컴포넌트(props) {
    return(
        <div>
            <h2>{props.carlist.model}</h2>
            <p>{props.carlist.lisence_plate}</p>
            <p>{props.carlist.type}</p>
            <img src={props.carlist.carimg}/>
            <p>{props.carlist.location}</p>
        </div>
    )

}
